import logo from './logo.svg';
import './App.css';
import {Home} from './Home';
import { Navbar } from './Navbar';

function App() {
  return (
    <div>
      <header>
        <h1>FitJim</h1>
        <Navbar />
      </header>
      <main>
        <Home />
      </main>
      <footer>
        <p>&copy; 2023 Fitnesz Felszerelések Webáruháza</p>
      </footer>
    </div>
  );
}

export default App;
